INSERT INTO `noticiadesglose` (`idDesglose`, `idNoticia`, `desglose`, `embebidoDesglose`, `estado`) VALUES
(1, 2, '<strong>El Banco Central proyecta un crecimiento del 2,5% para la economía de Ecuador en 2022. Mejorar ese indicador dependerá de la capacidad del país para atraer inversión. </strong> \r\n<br></br>\r\nUn año de impulso a las inversiones y al empleo para acelerar una recuperación económica que aún es lenta. Así se proyecta 2022. El Banco Central calcula un crecimiento de 2,5% en 2022, incluso menor al esperado para 2021 que es de 3,5%.\r\n<br></br>\r\nPara acelerar la reactivación económica, el Gobierno dará énfasis a la Ley para atracción de inversiones, que se espera en enero de 2022, y los acuerdos comerciales con México, la Alianza del Pacífico y China.\r\n<br></br>\r\nEcuador también impulsará con más fuerza la promoción de 50 proyectos públicos y privados en nueve sectores, empezando por los de hidrocarburos que podrían generar hasta el 30% de USD 30.000 millones esperados en inversiones. Por otro lado, la reforma laboral deberá hallar consensos en la Asamblea y, por eso, el Gobierno prevé su envío para el primer trimestre de 2022.', NULL, 'PB'),
(2, 2, '<strong>Crecimiento</strong> \r\n<br></br>\r\nEl Banco Central prevé que la economía ecuatoriana crezca 2,5% en 2022, menor al 3,55% esperado para 2021. El país está aún lejos de la recuperación económica que registrará la región. Por ejemplo, Colombia crecerá al 3,8% y Perú al 4,4% en 2022.\r\n<br></br>\r\nEl menor crecimiento de Ecuador en 2022 se deberá a una desaceleración de actividades como el camarón, la pesca o el comercio. Pero, en cambio, el Banco Central espera que la  inversión aumente 4,9%, debido a una mayor inyección de capitales en los sectores petrolero y minero. A eso se suma un aumento de las exportaciones. \r\n<br></br>\r\nAunque los organismos multilaterales son más optimistas sobre el desempeño de la economía ecuatoriana en 2022. El Banco Mundial prevé que el PIB de Ecuador crezca 3,4% y el Fondo Monetario Internacional (FMI) 3,5%.\r\n<br></br>\r\n<iframe scrolling=\"no\" frameborder=\"0\" title=\"Interactive or visual content\" sandbox=\"allow-same-origin allow-forms allow-scripts allow-downloads allow-popups allow-popups-to-escape-sandbox allow-top-navigation-by-user-activation\" src=\"https://flo.uri.sh/visualisation/8258286/embed?auto=1\" style=\"width: 100%; height: 400px;\"></iframe>', NULL, 'PB'),
(3, 3, '<strong>Actualizado a las 11h07</strong>\r\n<br></br>\r\nLos integrantes del Comité de Operaciones de Emergencia (COE) de Guayaquil ofrecieron un balance de la incidencia del COVID-19 en Guayaquil durante la última semana de diciembre pasado.', NULL, 'PB'),
(4, 3, 'Carlos Farhat, epidemiólogo y director de la Mesa de Salud del COE local, confirmó que la urbe ahora convive con una tendencia “acelerada” de incremento de contagios de COVID-19 a diferencia de la penúltima semana del año anterior que ya se evidenciaba un “alza leve” de infectados, con una duplicidad de casos.\r\n<br></br>\r\nEn la semana pasada hubo un aumento “inusitado” del número de infectados, dijo el especialista.\r\n<br></br>\r\nFarhat dijo que en la última semana del 2021 se reportaron más de 1.700 casos nuevos en la ciudad, según datos recogidos de los informes del Servicio Nacional de Gestión de Riesgos y Emergencias. Guayaquil pasó de 53.242 a 54.963 casos confirmados con prueba PCR del 27 al 31 de diciembre de 2021.', NULL, 'PB');

